import React from 'react';

function Building(props)
	{
	console.log(props)
		return(
		<>
			<div> BUY: {props.buyPrice} </div>
			 <div>SELL: {props.sellPrice} </div>
		<button 
		name={props.name} 
		onClick={props.HandleClick} 
		isBuyable = {props.isBuyable}
		value="click me"
		count={props.count}

		>
		{props.name}
		<div> COUNT:{props.count}
		</div>
		</button>
			
		</>

		)
}


export default Building;
